func base64Toimage() {
	imgcontent, err := base64.StdEncoding.DecodeString(imgbase64)
	if err != nil {
		panic(err)
	}
	reader := bytes.NewReader(imgcontent)
	cfg, str, err := image.DecodeConfig(reader)
	if err != nil {
		panic(err)
	}
	fmt.Printf("cfg:%+v", cfg)
	fmt.Println(str)
}

func file2Image() {
	f1, err := os.Open("./golang.jpg")
	if err != nil {
		panic(err)
	}
	defer f1.Close()
	cfg, str, err := image.DecodeConfig(f1)
	if err != nil {
		panic(err)
	}
	fmt.Printf("cfg:%+v", cfg)
	fmt.Println(str)
}

// []byte转reader
func Base64Tofile() {
	// []byte转reader
	imgcontent, err := base64.StdEncoding.DecodeString(imgbase64)
	if err != nil {
		panic(err)
	}
	fnew, err := os.Create("./new.jpg")
	if err != nil {
		panic(err)
	}
	defer fnew.Close()
	reader := bytes.NewReader(imgcontent)
	io.Copy(fnew, reader)
}
func RWfile() {
	f1, err := os.Open("./golang.jpg")
	if err != nil {
		panic(err)
	}
	defer f1.Close()
	fnew, err := os.Create("./new.jpg")
	if err != nil {
		panic(err)
	}
	defer fnew.Close()
	io.Copy(fnew, f1)
}

